import React from "react";
import { css, cx } from "emotion";
import "./App.css";

const Board = props => (
  <div>
    <h1>@{props.name}</h1>
    <iframe
      src={`https://fortnitetracker.com/profile/psn/${props.name}`}
      frameborder="0"
      title={props.name}
    />
  </div>
);
function App() {
  return (
    <div
      className={cx(
        "App",
        css`
          display: grid;
        `
      )}
    >
      {[
        "iamfabriceg",
        "SKIDIP%20LUKYVJ",
        "SKIPID%20AntShelby",
        "SKIPID%20Kingom"
      ].map(item => (
        <Board name={item} />
      ))}
    </div>
  );
}

export default App;
